import { Box, Grid, Typography } from '@mui/material';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import GitHubIcon from '@mui/icons-material/GitHub';
import CallIcon from '@mui/icons-material/Call';
import EmailIcon from '@mui/icons-material/Email';

import '../../style/menu.css';
import '../../style/footer.css';
function Footer() {
  return (
    <footer className="footer">
      <Box
        style={{
          backgroundColor: 'black',
          width: '100%',
          height: 100
        }}
      >
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography color="white">Social</Typography>
            <FacebookIcon className="menu-side-icon" />
            <InstagramIcon className="menu-side-icon" />
            <GitHubIcon className="menu-side-icon" />
            <CallIcon className="menu-side-icon" />
            <EmailIcon className="menu-side-icon" />
          </Grid>
          <Grid xs={6}>
            <Typography>xs=4</Typography>
          </Grid>
          <Grid xs={12}>
            <Typography>xs=4</Typography>
          </Grid>
        </Grid>
      </Box>
    </footer>
  );
}
export { Footer };
